# Create a function for building a model from statsmodel and returning the summary

def buildstat_model(y_train, X_train_rfe, sm):
    X_train_sm = sm.add_constant(X_train_rfe)
    lr = sm.OLS(y_train, X_train_sm)
    lr_model = lr.fit()
    return lr_model.summary()

